import React from "react"; 
import "./Aethesticism.css";
const Aethesticism = () => {
    return (
    <React.Fragment>
    <h1>Aethesticism Page</h1>
            <div className='main-container'>
            <span className='text'>Lifestyle</span>
            <div className='wrapper' />
            <div className='group'>
                <span className='text-2'>Done ^^</span>
            </div>
            <div className='pic' />
            </div>
    </React.Fragment>
    )
};
export default Aethesticism
